import { Component } from "@angular/core";
import { CellConfig, jsPDF } from "jspdf";
import "jspdf-autotable";

@Component({
  selector: "app-root",
  templateUrl: "./app.component.html",
  styleUrls: ["./app.component.css"]
})
export class AppComponent {
  title = "Export To PDF";

  users = [
    {
      uid: "1",
      first: "Mark",
      last: "Otto",
      handle: "@mdo"
    },
    {
      uid: "2",
      first: "Jacob",
      last: "Thornton",
      handle: "@fat"
    },
    {
      uid: "2",
      first: "Larry the Bird",
      last: "Thornton",
      handle: "@twitter"
    }
  ];

  url = "/src/assets/image1.png";
  exportDataToPDF() {
    // Creating a unique file name for my PDF
    const fileName =
      this.title.replace(" ", "_") +
      "_" +
      Math.floor(Math.random() * 1000000 + 1) +
      ".pdf";
    console.log(fileName);

    function addImageProcess(src) {
      return new Promise((resolve, reject) => {
        let img = new Image();
        img.src = src;
        img.onload = () => resolve(img);
        img.onerror = reject;
      });
    }

    // Default export is a4 paper, portrait, using millimeters for units
    const doc = new jsPDF("l", "mm", "a4");
    doc.setFontSize(14);
    doc.setFont("helvetica", "bold");
    const titleXPos =
      doc.internal.pageSize.getWidth() / 2 - doc.getTextWidth(this.title) / 2;
    doc.text(this.title, titleXPos, 20);
    doc.setFont("helvetica", "normal");
    doc.setFontSize(14);
    //const image = addImageProcess(this.url);
    const urlImage = "/src/assets/image1.png";
    const image2 =
      "data:image/jpeg;base64,";
    // const image3 = image64. ;
    doc.addImage(image2, "png", 5, 25, 0, 0);

    let columns = ["ID", "Name", "Country"];
    let rows = [
      [1, "Shaw", "Tanzania"],
      [2, "Nelson", "Kazakhstan"],
      [3, "Garcia", "Madagascar"]
    ];
    (doc as any).autoTable(columns, rows, {
      startY: 70,
      margin: { horizontal: 10 },
      styles: { halign: "center" },
      headStyles: { fillColor: [124, 95, 240] },
      alternateRowStyles: { fillColor: [231, 215, 252] },
      tableLineColor: [124, 95, 240],
      tableLineWidth: 0.1
    });
    doc.table(
      20,
      120,
      this._getDataForPdfTable(),
      this._createHeadersForPdfTable(["uid", "first", "last", "handle"]),
      { autoSize: false }
    );

    doc.save(fileName);
  }

  private _createHeadersForPdfTable(keys: string[]) {
    const result: CellConfig[] = [];
    for (let i = 0; i < keys.length; i += 1) {
      result.push({
        name: keys[i],
        prompt: keys[i],
        width: 55,
        align: "center",
        padding: 10
      });
    }
    return result;
  }

  private _getDataForPdfTable() {
    const data = [];
    for (let i = 0; i < this.users.length; i++) {
      data.push({
        uid: this.users[i].uid,
        first: this.users[i].first,
        last: this.users[i].last,
        handle: this.users[i].handle
      });
    }
    return data;
  }
}
